DROP TABLE IF EXISTS `rzrv_Barcodes`;
CREATE TABLE `rzrv_Barcodes` (
  `barcode` varchar(20) NOT NULL,
  `sold` varchar(3) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

-- tento neni platny, ale pro ukazku


DROP TABLE IF EXISTS `rzrv_Hall`;
CREATE TABLE `rzrv_Hall` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(300) character set utf8 collate utf8_czech_ci NOT NULL,
  `hall_type_ID` int(11) NOT NULL,
  `order` int(11) NOT NULL,
  `model` varchar(300) character set utf8 collate utf8_czech_ci NOT NULL,
  `model_small` varchar(300) character set utf8 collate utf8_czech_ci NOT NULL,
  `width` int(11) NOT NULL COMMENT 'sirka mapy v pixelech',
  `height` int(11) NOT NULL COMMENT 'vyska mapy v pixelech',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `rzrv_Hall_type`;
CREATE TABLE `rzrv_Hall_type` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(300) character set utf8 collate utf8_czech_ci NOT NULL COMMENT 'typ - na stání, na sezení',
  `order` int(11) NOT NULL,
  `price` int(11) NOT NULL,
  `reserv_days` int(11) NOT NULL COMMENT 'jak dlouho je mozne rezervovat',
  `reserv_from_dt` datetime NOT NULL,
  `reserv_to_dt` datetime NOT NULL,
  `cancel_to_dt` datetime NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `rzrv_Prispevek`;
CREATE TABLE `rzrv_Prispevek` (
  `forced_key` int(11) NOT NULL auto_increment,
  `user_ID` int(11) NOT NULL,
  `text` varchar(10000) character set utf8 collate utf8_czech_ci NOT NULL,
  `time` datetime NOT NULL,
  PRIMARY KEY  (`forced_key`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `rzrv_Seats`;
CREATE TABLE `rzrv_Seats` (
  `seat_number` int(11) NOT NULL auto_increment,
  `hall_ID` int(11) NOT NULL,
  `status` varchar(3) NOT NULL default 'A' COMMENT 'status vstupenky (A - available, R - reserved, S - sold)',
  `sold_dt` datetime NOT NULL COMMENT 'cas prodeje vstupenky',
  `sold_by_ID` int(11) NOT NULL COMMENT 'ID uzivatele, ktery vstupenku prodal',
  `label` char(30) NOT NULL COMMENT 'textovy popisek sedadla',
  `customer_ID` int(11) NOT NULL COMMENT 'ID uzivatele, co ma vstupenku',
  `table_number` int(11) NOT NULL,
  `x` int(11) NOT NULL,
  `y` int(11) NOT NULL,
  `reserv_dt` datetime NOT NULL COMMENT 'V pripade rezervace - kdy',
  `reserv_to_dt` datetime NOT NULL COMMENT 'v pripade rezervace - dokdy',
  `cancel_to_dt` datetime NOT NULL COMMENT 'v pripade rezervace - kdy mozno koncit',
  `reserved_by` int(11) NOT NULL COMMENT 'kdo rezervoval tento listek?',
  `barcode` varchar(20) NOT NULL,
  `pseudorandom` varchar(60) NOT NULL,
  PRIMARY KEY  (`seat_number`,`hall_ID`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `rzrv_Session`;
CREATE TABLE `rzrv_Session` (
  `id` int(11) NOT NULL auto_increment,
  `user_ID` int(11) NOT NULL,
  `timestamp` datetime NOT NULL,
  `session_key` char(50) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `rzrv_Tables`;
CREATE TABLE `rzrv_Tables` (
  `hall_ID` int(11) NOT NULL COMMENT 'ID mistnosti (cizi klic)',
  `table_number` int(11) NOT NULL COMMENT 'cislo stolu v mistnosti (klic)',
  `x` int(11) NOT NULL COMMENT 'x-ova souradnice na mape mistnosti',
  `y` int(11) NOT NULL COMMENT 'y-ova souradnice na mape mistnosti',
  `type` char(20) default NULL COMMENT 'typ stolu (round,rectangular)',
  `width` int(11) default NULL COMMENT 'sirka obdelnikoveho stolu',
  `length` int(11) default NULL COMMENT 'delka obdelnikoveho stolu',
  `radius` int(11) default NULL COMMENT 'polomer kulateho stolu',
  `label` char(30) default NULL COMMENT 'textovy popisek stolu',
  `seat_count` int(11) default NULL COMMENT 'pocet sedadel u stolu',
  PRIMARY KEY  (`hall_ID`,`table_number`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `rzrv_User`;
CREATE TABLE `rzrv_User` (
  `id` int(11) NOT NULL auto_increment,
  `hashed_password` varchar(100) NOT NULL,
  `status` tinytext NOT NULL,
  `login` varchar(300) NOT NULL,
  `address` varchar(300) character set utf8 collate utf8_czech_ci NOT NULL,
  `firstname` varchar(300) character set utf8 collate utf8_czech_ci NOT NULL,
  `lastname` varchar(300) character set utf8 collate utf8_czech_ci NOT NULL,
  PRIMARY KEY  (`id`),
  UNIQUE KEY `login` (`login`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `rzrv_Walls`;
CREATE TABLE `rzrv_Walls` (
  `hall_ID` int(11) NOT NULL COMMENT 'ID mistnosti (cizi klic)',
  `x` int(11) NOT NULL COMMENT 'x-ova souradnice na mape mistnosti',
  `y` int(11) NOT NULL COMMENT 'y-ova souradnice na mape mistnosti',
  `width` int(11) NOT NULL COMMENT 'sirka steny',
  `length` int(11) NOT NULL COMMENT 'delka steny',
  `text` char(255) default NULL COMMENT 'textovy popis steny',
  `forced_key` int(11) NOT NULL auto_increment COMMENT 'umely klic',
  PRIMARY KEY  (`hall_ID`,`forced_key`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `rzrv_backup_Expired`;
CREATE TABLE `rzrv_backup_Expired` (
  `forced_key` int(11) NOT NULL auto_increment,
  `seat_number` int(11) NOT NULL,
  `hall_ID` int(11) NOT NULL,
  `customer_ID` int(11) NOT NULL,
  `reserv_to_dt` datetime NOT NULL,
  `reserv_dt` datetime NOT NULL,
  `expired_dt` datetime NOT NULL,
  PRIMARY KEY  (`forced_key`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `rzrv_backup_Sold`;
CREATE TABLE `rzrv_backup_Sold` (
  `id` int(11) NOT NULL auto_increment COMMENT 'nic moc nerikajici ID',
  `seat_number` int(11) NOT NULL,
  `hall_ID` int(11) NOT NULL,
  `customer_ID` int(11) NOT NULL,
  `reserv_dt` datetime NOT NULL,
  `reserv_to_dt` datetime NOT NULL,
  `sold_dt` datetime NOT NULL,
  `sold_by_ID` int(11) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


